import { useState } from 'react';

function RoomLobby() {
    const [playerReady, setPlayerReady] = useState(false);

    const setReady = () => {
        setPlayerReady(!playerReady);
    }

    return (
        <div>
            <h1>Lobby</h1>
            <button onClick={setReady}>I am {!playerReady && "not"} ready</button>
        </div>
    );
}

export default RoomLobby;
